the Billy Joel ballad, â€œNew York State of Mind,â€ and Nas â€˜ â€œN.Y. State of Mind.â€  â€œEmpire State of Mindâ€ stands as one of Hovâ€™s most successful singles. It was the first Jay-Z-lead single to ever top the Billboard â€œHot 100,â€ sitting at #1 for five consecutive weeks (also being the last number #1 in the 2000s). It has been certified 5x Multi-Platinum by the RIAA for sales of over 5.5 million in the United States. The track was nominated for three Grammy Awards, winning â€œBest Rap Songâ€ and â€œBest Rap/Sung Collaboration.â€ Expand      +203     1  1   Share    Q&A Find answers to frequently asked questions about the song and explore its deeper meaning Ask a question What has Jay said about the track?  Genius Answer 1 contributor What sticks out to me about the record is the aspiration and hope â€”that thereâ€™s a place where you can become something. But you have to be aware that thereâ€™s a downside to living in New York, or any major city. You can get sidetracked and swallowed up, which is why the third verse is the way it is. Iâ€™ve seen it happen so many times. But if you can overcome the trappings, you can be successful. Hit records resonate with the broadcast audience. The inspiration in that record connectedâ€”all over the world.  Why did Hov choose Alicia Keys to appear on the track with him?  Genius Answer 1 contributor Jay stated in an interview that after he first heard the trackâ€™s piano loops (which are sampled from â€œLove on a Two-Way Streetâ€ by The Moments), he immediately thought of Keys and wanted her to be featured on the song.  He has also said that his friend Mary J. Blige was initially considered for Keys' part, admitting that he was â€œtwo seconds awayâ€ from asking Blige to appear on the recordâ€™s chorus. He decided that using Blige on the song would have been a safe move, but that the combination of Keys' sound and piano talent had struck a chord with him.  What did JAY-Z say about "Empire State of Mind"?  Genius Answer 1 contributor In an interview with MTV , shortly before the duo performed the track at Game Two of the World Series at Yankee Stadium, Alicia Keys explained how her part on the track came about:   There was a first phone call, and Jay hit me up like, â€˜I feel like I have this record thatâ€™s going to be the anthem of New York. Heâ€™s like, 'The piano, the way the style [is], the whole flow â€“ and it couldnâ€™t be the anthem of New York without you.â€™  Iâ€™ve admired Jay-Z for a long time. Reasonable Doubt is my all-time favorite album, period, and heâ€™s been on the scene for long time. I always figured that we would do some type of collaboration, and finally, it came together with this.  Obviously, Iâ€™m very grateful to him for reaching out to me and for that type of ability to represent my hometown, like, that was crazy. So we went to the studio â€¦ I fell in love from the jump.   Keys also explained how she wanted to make sure she got the anthemic hook right:  I did try it a couple of times, but it was more about capturing the kind of grand feeling of it. With the way I sang it the first time, I was actually kind of sick, and I knew that he needed the record, so I was like, â€˜Let me get to it.â€™ â€¦ I came back and revisited it so that it could be what it is now. So it actually took a couple of times, but every time, the energy was just so high.  Does the track have an accompanying music video?  What did Hov have to say about his Jeezy shout-out?  How did this song perform on the charts?  Has this track received any certifications?  Who produced â€œEmpire State of Mindâ€ by JAY-Z?  When did JAY-Z release â€œEmpire State of Mindâ€?  Who wrote â€œEmpire State of Mindâ€ by JAY-Z?     The Hits Collection, VolumeÂ One    (2010) JAY-Z 1. Public Service Announcement 2. Run This Town 3. â€™03 Bonnie & Clyde 4. Encore 5. I Just Wanna Love U (Give It 2 Me) 6. Izzo (H.O.V.A.) 7. D.O.A. (Death of Auto-Tune) 8. 99 Problems 9. Empire State of Mind 10. Dirt Off Your Shoulde