s\'><\/script>\",\"deleted\":false,\"customPreview\":null,\"createdAt\":1253653325,\"community\":true,\"commentCount\":1,\"body\":{\"markdown\":\"*The Blueprint 3*\'s third single is a love song to Jay-Z and Alicia Keys\' home city of New York, which is also known as \\\"the Empire State.\\\" The title alludes to the [Billy Joel](/artists/Billy-joel) ballad, [\\\"New York State of Mind,\\\"](http://rock.rapgenius.com/Billy-joel-new-york-state-of-mind-lyrics) and [Nas](/artists/Nas)\' [\\\"N.Y. State of Mind.\\\"](https://genius.com/Nas-ny-state-of-mind-lyrics)\\n\\n\\\"Empire State of Mind\\\" stands as one of Hov\'s most successful singles. It was the first Jay-Z-lead single to ever top the *Billboard* \\\"Hot 100,\\\" sitting at #1 for five consecutive weeks (also being the last number #1 in the 2000s). It has been certified 5x Multi-Platinum by the *RIAA* for sales of over 5.5 million in the United States. The track was nominated for three Grammy Awards, winning \\\"Best Rap Song\\\" and \\\"Best Rap/Sung Collaboration.\\\"\",\"html\":\"<p><em>The Blueprint 3<\/em>â€™s third single is a love song to Jay-Z and Alicia Keys\' home city of New York, which is also known as â€œthe Empire State.â€ The title alludes to the <a href=\\\"https://genius.com/artists/Billy-joel\\\" rel=\\\"noopener\\\" data-api_path=\\\"/artists/16965\\\">Billy Joel<\/a> ballad, <a href=\\\"http://rock.genius.com/Billy-joel-new-york-state-of-mind-lyrics\\\" rel=\\\"noopener\\\" data-api_path=\\\"/songs/195634\\\">â€œNew York State of Mind,â€<\/a> and <a href=\\\"https://genius.com/artists/Nas\\\" rel=\\\"noopener\\\" data-api_path=\\\"/artists/56\\\">Nas<\/a>â€˜ <a href=\\\"https://genius.com/Nas-ny-state-of-mind-lyrics\\\" rel=\\\"noopener\\\" data-api_path=\\\"/songs/89\\\">â€œN.Y. State of Mind.â€<\/a><\/p>\\n\\n<p>â€œEmpire State of Mindâ€ stands as one of Hovâ€™s most successful singles. It was the first Jay-Z-lead single to ever top the <em>Billboard<\/em> â€œHot 100,â€ sitting at #1 for five consecutive weeks (also being the last number #1 in the 2000s). It has been certified 5x Multi-Platinum by the <em>RIAA<\/em> for sales of over 5.5 million in the United States. The track was nominated for three Grammy Awards, winning â€œBest Rap Songâ€ and â€œBest Rap/Sung Collaboration.â€<\/p>\"},\"beingCreated\":false,\"apiPath\":\"/annotations/3489810\",\"type\":\"annotation\"}},\"referents\":{\"2622\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":2622},\"2626\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":2626},\"2630\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":2630},\"2634\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":2634},\"2635\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":2635},\"2636\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":2636},\"2676\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":2676},\"3585\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":3585},\"3669\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":3669},\"3679\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":3679},\"3682\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":3682},\"5903\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":5903},\"5910\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":5910},\"5912\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":5912},\"5913\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":5913},\"5915\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":5915},\"5980\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":5980},\"5982\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":5982},\"12596\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":12596},\"16343\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":16343},\"16345\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":16345},\"17592\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":17592},\"27083\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":27083},\"42854\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":42854},\"48735\":{\"classification\":\"verified\",\"editorialState\":\"accepted\",\"id\":48735},\"62654\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":62654},\"192026\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":192026},\"197461\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":197461},\"226160\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":226160},\"241513\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":241513},\"1466268\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":1466268},\"2700732\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":2700732},\"3489810\":{\"annotations\":[3489810],\"annotatable\":{\"url\":\"https://genius.com/Jay-z-empire-state-of-mind-lyrics\",\"type\":\"song\",\"title\":\"Empire State of Mind\",\"linkTitle\":\"Empire State of Mind byÂ JAY-Z (Ft.Â AliciaÂ Keys)\",\"imageUrl\":\"https://images.genius.com/4ebced1abfe8116eb43e79192f5c0082.1000x1000x1.png\",\"id\":75,\"context\":\"JAY-Z\",\"clientTimestamps\":{\"lyricsUpdatedAt\":1726439892,\"updatedByHumanAt\":1726439892},\"apiPath\":\"/songs/75\"},\"twitterShareMessage\":\"â€œThe Blueprint 3â€™s third single is a love song to Jay-Z and Alicia Keys\' home city of New York, wâ€¦â€ â€”@Genius\",\"trackingPaths\":{\"concurrent\":\"/Jay-z-empire-state-of-mind-lyrics\",\"aggregate\":\"/3489810/Jay-z-empire-state-of-mind/Empire-state-of-mind\"},\"currentUserMetadata\":{\"relationships\":{},\"excludedPermissions\":[\"add_pinned_annotation_to\",\"add_community_annotation_to\"],\"permissions\":[]},\"verifiedAnnotatorIds\":[],\"url\":\"https://genius.com/3489810/Jay-z-empire-state-of-mind/Empire-state-of-mind\",\"songId\":75,\"range\":{\"content\":\"Empire State of Mind\"},\"path\":\"/3489810/Jay-z-empire-state-of-mind/Empire-state-of-mind\",\"isImage\":false,\"isDescription\":true,\"iosAppUrl\":\"genius://referents/3489810\",\"id\":3489810,\"fragment\":\"Empire State of Mind\",\"classification\":\"accepted\",\"apiPath\":\"/referents/3489810\",\"annotatorLogin\":\"hellrel\",\"annotatorId\":2,\"type\":\"referent\"},\"6720536\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":6720536},\"11136386\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":11136386},\"11136393\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":11136393},\"11174535\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":11174535},\"11447506\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":11447506},\"11447523\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":11447523},\"11447998\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":11447998},\"11448021\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":11448021},\"15449322\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":15449322},\"28747614\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":28747614}},\"answers\":{\"25597\":{\"authors\":[{\"user\":1729630,\"pinnedRole\":null,\"attribution\":1,\"type\":\"user_attribution\"}],\"answerSource\":null,\"currentUserMetadata\":{\"interactions\":{\"vote\":null},\"excludedPermissions\":[\"vote\",\"edit\",\"destroy\"],\"permissions\":[]},\"votesTotal\":12,\"id\":25597,\"hasVoters\":true,\"editorialState\":\"normal\",\"createdAt\":1488576796,\"bodyForEdit\":\"Jay stated in [an interview](https://en.wikipedia.org/wiki/Empire_State_of_Mind#Track_listings_and_formats) that after he first heard the track\'s piano loops (which are sampled from [\\\"Love on a Two-Way Street\\\"](https://genius.com/The-moments-love-on-a-two-way-street-lyrics) by The Moments), he immediately thought of Keys and wanted her to be featured on the song. \\n\\nHe has also said that his friend [Mary J. Blige](https://genius.com/artists/Mary-j-blige) was [initially considered](http://www.digitalspy.com/music/news/a204310/jay-z-keys-was-second-choice-on-empire/) for Keys\' part, admitting that he was \\\"two seconds away\\\" from asking Blige to appear on the record\'s chorus. He decided that using Blige on the song would have been a safe move, but that the combination of Keys\' sound and piano talent had struck a chord with him.\",\"body\":{\"markdown\":\"Jay stated in [an interview](https://en.wikipedia.org/wiki/Empire_State_of_Mind#Track_listings_and_formats) that after he first heard the track\'s piano loops (which are sampled from [\\\"Love on a Two-Way Street\\\"](https://genius.com/The-moments-love-on-a-two-way-street-lyrics) by The Moments), he immediately thought of Keys and wanted her to be featured on the song. \\n\\nHe has also said that his friend [Mary J. Blige](https://genius.com/artists/Mary-j-blige) was [initially considered](http://www.digitalspy.com/music/news/a204310/jay-z-keys-was-second-choice-on-empire/) for Keys\' part, admitting that he was \\\"two seconds away\\\" from asking Blige to appear on the record\'s chorus. He decided that using Blige on the song would have been a safe move, but that the combination of Keys\' sound and piano talent had struck a chord with him.\",\"html\":\"<p>Jay stated in <a href=\\\"https://en.wikipedia.org/wiki/Empire_State_of_Mind#Track_listings_and_formats\\\" rel=\\\"noopener nofollow\\\">an interview<\/a> that after he first heard the trackâ€™s piano loops (which are sampled from <a href=\\\"https://genius.com/The-moments-love-on-a-two-way-street-lyrics\\\" rel=\\\"noopener\\\" data-api_path=\\\"/songs/662412\\\">â€œLove on a Two-Way Streetâ€<\/a> by The Moments), he immediately thought of Keys and wanted her to be featured on the song.<\/p>\\n\\n<p>He has also said that his friend <a href=\\\"https://genius.com/artists/Mary-j-blige\\\" rel=\\\"noopener\\\" data-api_path=\\\"/artists/358\\\">Mary J. Blige<\/a> was <a href=\\\"http://www.digitalspy.com/music/news/a204310/jay-z-keys-was-second-choice-on-empire/\\\" rel=\\\"noopener nofollow\\\">initially considered<\/a> for Keys\' part, admitting that he was â€œtwo seconds awayâ€ from asking Blige to appear on the recordâ€™s chorus. He decided that using Blige on the song would have been a safe move, but that the combination of Keys\' sound and piano talent had struck a chord with him.<\/p>\"},\"type\":\"answer\"},\"25598\":{\"authors\":[{\"user\":1729630,\"pinnedRole\":null,\"attribution\":1,\"type\":\"user_attribution\"}],\"answerSource\":null,\"currentUserMetadata\":{\"interactions\":{\"vote\":null},\"excludedPermissions\":[\"vote\",\"edit\",\"destroy\"],\"permissions\":[]},\"votesTotal\":10,\"id\":25598,\"hasVoters\":true,\"editorialState\":\"normal\",\"createdAt\":1488577048,\"bodyForEdit\":\"[In an interview with *MTV*,](http://www.mtv.com/news/1625114/alicia-keys-grateful-to-jay-z-for-empire-state-of-mind/) shortly before the duo [performed the track at Game Two of the World Series](https://www.youtube.com/watch?v=N7HAMsB2FLc) at Yankee Stadium, Alicia Keys explained how her part on the track came about:\\n> There was a first phone call, and Jay hit me up like, \'I feel like I have this record that\'s going to be the anthem of New York. He\'s like, \'The piano, the way the style [is], the whole flow - and it couldn\'t be the anthem of New York without you.\'\\n\\n> I\'ve admired Jay-Z for a long time. [*Reasonable Doubt*](https://genius.com/albums/Jay-z/Reasonable-doubt) is my all-time favorite album, period, and he\'s been on the scene for long time. I always figured that we would do some type of collaboration, and finally, it came together with this.\\n\\n> Obviously, I\'m very grateful to him for reaching out to me and for that type of ability to represent my hometown, like, that was crazy. So we went to the studio ... I fell in love from the jump.\\n\\nKeys also explained how she wanted to make sure she got the anthemic hook right: \\n> I did try it a couple of times, but it was more about capturing the kind of grand feeling of it. With the way I sang it the first time, I was actually kind of sick, and I knew that he needed the record, so I was like, \'Let me get to it.\' ... I came back and revisited it so that it could be what it is now. So it actually took a couple of times, but every time, the energy was just so high.\",\"body\":{\"markdown\":\"[In an interview with *MTV*,](http://www.mtv.com/news/1625114/alicia-keys-grateful-to-jay-z-for-empire-state-of-mind/) shortly before the duo [performed the track at Game Two of the World Series](https://www.youtube.com/watch?v=N7HAMsB2FLc) at Yankee Stadium, Alicia Keys explained how her part on the track came about:\\n> There was a first phone call, and Jay hit me up like, \'I feel like I have this record that\'s going to be the anthem of New York. He\'s like, \'The piano, the way the style [is], the whole flow - and it couldn\'t be the anthem of New York without you.\'\\n\\n> I\'ve admired Jay-Z for a long time. [*Reasonable Doubt*](https://genius.com/albums/Jay-z/Reasonable-doubt) is my all-time favorite album, period, and he\'s been on the scene for long time. I always figured that we would do some type of collaboration, and finally, it came together with this.\\n\\n> Obviously, I\'m very grateful to him for reaching out to me and for that type of ability to represent my hometown, like, that was crazy. So we went to the studio ... I fell in love from the jump.\\n\\nKeys also explained how she wanted to make sure she got the anthemic hook right: \\n> I did try it a couple of times, but it was more about capturing the kind of grand feeling of it. With the way I sang it the first time, I was actually kind of sick, and I knew that he needed the record, so I was like, \'Let me get to it.\' ... I came back and revisited it so that it could be what it is now. So it actually took a couple of times, but every time, the energy was just so high.\",\"html\":\"<p><a href=\\\"http://www.mtv.com/news/1625114/alicia-keys-grateful-to-jay-z-for-empire-state-of-mind/\\\" rel=\\\"noopener nofollow\\\">In an interview with <em>MTV<\/em>,<\/a> shortly before the duo <a href=\\\"https://www.youtube.com/watch?v=N7HAMsB2FLc\\\" rel=\\\"noopener nofollow\\\">performed the track at Game Two of the World Series<\/a> at Yankee Stadium, Alicia Keys explained how her part on the track came about:<\/p>\\n\\n<blockquote>\\n<p>There was a first phone call, and Jay hit me up like, â€˜I feel like I have this record thatâ€™s going to be the anthem of New York. Heâ€™s like, \'The piano, the way the style [is], the whole flow â€“ and it couldnâ€™t be the anthem of New York without you.â€™<\/p>\\n\\n<p>Iâ€™ve admired Jay-Z for a long time. <a href=\\\"https://genius.com/albums/Jay-z/Reasonable-doubt\\\" rel=\\\"noopener\\\" data-api_path=\\\"/albums/4063\\\"><em>Reasonable Doubt<\/em><\/a> is my all-time favorite album, period, and heâ€™s been on the scene for long time. I always figured that we would do some type of collaboration, and finally, it came together with this.<\/p>\\n\\n<p>Obviously, Iâ€™m very grateful to him for reaching out to me and for that type of ability to represent my hometown, like, that was crazy. So we went to the studio â€¦ I fell in love from the jump.<\/p>\\n<\/blockquote>\\n\\n<p>Keys also explained how she wanted to make sure she got the anthemic hook right:<\/p>\\n\\n<blockquote><p>I did try it a couple of times, but it was more about capturing the kind of grand feeling of it. With the way I sang it the first time, I was actually kind of sick, and I knew that he needed the record, so I was like, â€˜Let me get to it.â€™ â€¦ I came back and revisited it so that it could be what it is now. So it actually took a couple of times, but every time, the energy was just so high.<\/p><\/blockquote>\"},\"type\":\"answer\"},\"25600\":{\"authors\":[{\"user\":1729630,\"pinnedRole\":null,\"attribution\":1,\"type\":\"user_attribution\"}],\"answerSource\":null,\"currentUserMetadata\":{\"interactions\":{\"vote\":null},\"excludedPermissions\":[\"vote\",\"edit\",\"destroy\"],\"permissions\":[]},\"votesTotal\":6,\"id\":25600,\"hasVoters\":true,\"editorialState\":\"normal\",\"createdAt\":1488577894,\"bodyForEdit\":\"The music video was directed by frequent Jay-Z collaborator [Hype Williams.](https://en.wikipedia.org/wiki/Hype_Williams_videography) It was filmed on October 1, 2009 in various locations around New York City, including Times Square, Brooklyn, TriBeCa, Harlem, Yankee Stadium and Ground Zero.\\n \\n> [It is a masterpiece video.](http://youknowigotsoul.com/jay-z-alicia-keys-record-empire-state-of-mind-part-2) The way it\'s put together, it is so New York. You totally get it and understand it. It\'s artistic. It\'s hard. It\'s beautiful. It\'s like everything. And definitely getting to be in the middle of Times Square on my piano [with] Jay, representing our home city is a triumph. It was unbelievable.\\n\\n\\\"Empire State of Mind\\\" is one of the music videos Jay [pulled down](http://cabletelevisionbundles.s9.com/blog/why-jay-z-may-have-pulled-his-music-videos-from-vevo/) from *YouTube* when he purchased his streaming service [*TIDAL*.](listen.tidal.com) The royalty rates paid for each *YouTube* view are very low (\$0.001), so Hov wants to instead encourage any potential viewers to subscribe and pay their fair share for his art. The full HD video is [available to view on *TIDAL*.](http://tidal.com/#!/video/38036303)\",\"body\":{\"markdown\":\"The music video was directed by frequent Jay-Z collaborator [Hype Williams.](https://en.wikipedia.org/wiki/Hype_Williams_videography) It was filmed on October 1, 2009 in various locations around New York City, including Times Square, Brooklyn, TriBeCa, Harlem, Yankee Stadium and Ground Zero.\\n \\n> [It is a masterpiece video.](http://youknowigotsoul.com/jay-z-alicia-keys-record-empire-state-of-mind-part-2) The way it\'s put together, it is so New York. You totally get it and understand it. It\'s artistic. It\'s hard. It\'s beautiful. It\'s like everything. And definitely getting to be in the middle of Times Square on my piano [with] Jay, representing our home city is a triumph. It was unbelievable.\\n\\n\\\"Empire State of Mind\\\" is one of the music videos Jay [pulled down](http://cabletelevisionbundles.s9.com/blog/why-jay-z-may-have-pulled-his-music-videos-from-vevo/) from *YouTube* when he purchased his streaming service [*TIDAL*.](listen.tidal.com) The royalty rates paid for each *YouTube* view are very low (\$0.001), so Hov wants to instead encourage any potential viewers to subscribe and pay their fair share for his art. The full HD video is [available to view on *TIDAL*.](http://tidal.com/#!/video/38036303)\",\"html\":\"<p>The music video was directed by frequent Jay-Z collaborator <a href=\\\"https://en.wikipedia.org/wiki/Hype_Williams_videography\\\" rel=\\\"noopener nofollow\\\">Hype Williams.<\/a> It was filmed on October 1, 2009 in various locations around New York City, including Times Square, Brooklyn, TriBeCa, Harlem, Yankee Stadium and Ground Zero.<\/p>\\n\\n<blockquote><p><a href=\\\"http://youknowigotsoul.com/jay-z-alicia-keys-record-empire-state-of-mind-part-2\\\" rel=\\\"noopener nofollow\\\">It is a masterpiece video.<\/a> The way itâ€™s put together, it is so New York. You totally get it and understand it. Itâ€™s artistic. Itâ€™s hard. Itâ€™s beautiful. Itâ€™s like everything. And definitely getting to be in the middle of Times Square on my piano [with] Jay, representing our home city is a triumph. It was unbelievable.<\/p><\/blockquote>\\n\\n<p>â€œEmpire State of Mindâ€ is one of the music videos Jay <a href=\\\"http://cabletelevisionbundles.s9.com/blog/why-jay-z-may-have-pulled-his-music-videos-from-vevo/\\\" rel=\\\"noopener nofollow\\\">pulled down<\/a> from <em>YouTube<\/em> when he purchased his streaming service <a href=\\\"http://listen.tidal.com/\\\" rel=\\\"noopener nofollow\\\"><em>TIDAL<\/em>.<\/a> The royalty rates paid for each <em>YouTube<\/em> view are very low (\$0.001), so Hov wants to instead encourage any potential viewers to subscribe and pay their fair share for his art. The full HD video is <a href=\\\"http://tidal.com/#!/video/38036303\\\" rel=\\\"noopener nofollow\\\">available to view on <em>TIDAL<\/em>.<\/a><\/p>\"},\"type\":\"answer\"},\"37419\":{\"authors\":[{\"user\":1729630,\"pinnedRole\":null,\"attribution\":1,\"type\":\"user_attribution\"}],\"answerSource\":null,\"currentUserMetadata\":{\"interactions\":{\"vote\":null},\"excludedPermissions\":[\"vote\",\"edit\",\"destroy\"],\"permissions\":[]},\"votesTotal\":12,\"id\":37419,\"hasVoters\":true,\"editorialState\":\"normal\",\"createdAt\":1495954484,\"bodyForEdit\":\"> [What sticks out to me about the record is the aspiration and hope](http://4.bp.blogspot.com/-Gb5kyV5iGuc/VT-sNn6138I/AAAAAAAAGMo/0oM1YUr4SgI/s1600/6.jpg)â€”that there\'s a place where you can become something. But you have to be aware that there\'s a downside to living in New York, or any major city. You can get sidetracked and swallowed up, which is why the third verse is the way it is. I\'ve seen it happen so many times. But if you can overcome the trappings, you can be successful. Hit records resonate with the broadcast audience. The inspiration in that record connectedâ€”all over the world.\",\"body\":{\"markdown\":\"> [What sticks out to me about the record is the aspiration and hope](http://4.bp.blogspot.com/-Gb5kyV5i